    rootClasses.push(classes.active);
  }

  const handleClick = () => {
    setVisible(false);
  };

  return (
    <div className={rootClasses.join(' ')} onClick={handleClick}>
      <div className={myModalNavigation__content}>Lorem ipsum dolor sit amet consectetur adipisicing elit. Vel nemo rerum, iure maxime ipsa voluptas soluta quas! Perspiciatis in necessitatibus, dicta dignissimos facilis temporibus quaerat! Porro dolorem voluptatem ratione dolor!</div>
    </div>
  );
};

